import React, { useState, useEffect } from 'react';

function FacultyDirectory() {
  const [facultyNames, setFacultyNames] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetch('http://localhost:3001/api/faculty-directory')
      .then(response => {
        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }
        return response.json();
      })
      .then(data => {
        // Assuming data is an array of objects with a 'name' field
        const names = data.map(member => member.name);
        setFacultyNames(names);
      })
      .catch(error => {
        console.error('Error fetching faculty data:', error);
        setError(error.toString());
      });
  }, []);

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div className="faculty-directory">
      <h1>Faculty Directory</h1>
      <ul className="faculty-list">
        {facultyNames.map((name, index) => (
          <li key={index}>{name}</li>
        ))}
      </ul>
    </div>
  );
}

export default FacultyDirectory;
